    private void goButtonActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_goButtonActionPerformed
        jNotFound.setText(" ");
        jFound.setText(" ");
        jFound1.setText(" ");
        StringBuilder addThisToList = new StringBuilder();
        if(linearButton.isSelected()){
            MySearchClass sc = new MySearchClass("Linear",Integer.valueOf(jTextField2.getText()));
            long[] returnedValues = new long[2];
            returnedValues=sc.returnTheStuff();
            if(returnedValues[0]<0){
                jNotFound.setText("The required element was not found!");
                return;
            }else{
                jFound.setText("Found at index "+returnedValues[0]+".\n");
                jFound1.setText("And it was required "+((long)(returnedValues[1]/1000))+" milliseconds to find it.\n");
                addThisToList.append("Linear,"+jTextField2.getText()+",#"+String.valueOf(returnedValues[0])+",t="+String.valueOf((long)(returnedValues[1]/1000))+"ms");
            }
        }else if(binaryButton.isSelected()){
            MySearchClass sc = new MySearchClass("Binary",Integer.valueOf(jTextField2.getText()));
            long[] returnedValues = new long[2];
            returnedValues=sc.returnTheStuff();
            if(returnedValues[0]<0){
                jNotFound.setText("The required element was not found!");
                return;
            }else{
                jFound.setText("Found at index "+returnedValues[0]+".\n");
                jFound1.setText("And it was required "+((long)(returnedValues[1]/1000))+" milliseconds to find it.\n");
                addThisToList.append("Binary,"+jTextField2.getText()+",#"+String.valueOf(returnedValues[0])+",t="+String.valueOf((long)(returnedValues[1]/1000))+"ms");
            }
        }else if(interButton.isSelected()){
            MySearchClass sc = new MySearchClass("Interpolation",Integer.valueOf(jTextField2.getText()));
            long[] returnedValues = new long[2];
            returnedValues=sc.returnTheStuff();
            if(returnedValues[0]<0){
                jNotFound.setText("The required element was not found!");
                return;
            }else{
                jFound.setText("Found at index "+returnedValues[0]+".\n");
                jFound1.setText("And it was required "+((long)(returnedValues[1]/1000))+" milliseconds to find it.\n");
                addThisToList.append("I/P,"+jTextField2.getText()+",#"+String.valueOf(returnedValues[0])+",t="+String.valueOf((long)(returnedValues[1]/1000))+"ms");
            }
        }
        dlm2.addElement(addThisToList.toString());
        jList.setModel(dlm2);
    }//GEN-LAST:event_goButtonActionPerformed

