    private void jButton2ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton2ActionPerformed
        jRBstatus.setText("Working...");
        elementsCounter=0;
        fileForExperiment=jRedBlackPath.getText();
        try(BufferedReader myBr = new BufferedReader(new FileReader(jRedBlackPath.getText()))){
            String line=myBr.readLine();
            int x=0;
            mrbt = new MyRedBlackTree(Integer.valueOf(line));
            elementsCounter++;
            while((line=myBr.readLine())!=null){
                mrbt.insertData(Integer.valueOf(line));
                System.out.println("The number "+line+" added to the RB Tree.");
                elementsCounter++;
            }
            myBr.close();
            System.out.println("Operation finished!");
            jRBstatus.setText("Operation Completed Succesfully!");
            rbTree=true;
        }catch(Exception e){
            System.out.println("Something went wrong reading the file.\n");
            jRBstatus.setText("There was an error creating the RB Tree.");
        }
    }//GEN-LAST:event_jButton2ActionPerformed

    private void jRBsearchActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jRBsearchActionPerformed
        int[] searchResults = new int[4];
        StringBuilder addThisToList = new StringBuilder();
        searchResults = mrbt.mySearch(Integer.valueOf(jRBdata.getText()));
        if(searchResults[2]==0){
            addThisToList.append("Element "+jRBdata.getText()+" not found.");
        }else{
            addThisToList.append("Element "+searchResults[0]+" found. Height: "+searchResults[1]+". Time: "+((long)(searchResults[3]/1000))+"ms");
        }
        dlm3.addElement(addThisToList.toString());
        jListRBhistory.setModel(dlm3);
    }//GEN-LAST:event_jRBsearchActionPerformed

    private void jExecuteTimesActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jExecuteTimesActionPerformed
        if(!rbTree || !sortedFile){
            JOptionPane.showMessageDialog(null, "Please create the files of Part A and Part C,\nbefore running the experiment.");
            return;
        }
        if(Integer.valueOf(String.valueOf(jTextField4.getText()))>(elementsCounter/2)){
            JOptionPane.showMessageDialog(null, "Please enter a smaller number of elements,\nand then run the experiment.");
            return;
        }
        
        if(myList.isEmpty())
            readFileFun();  
        
        DefaultListModel<String> dlmLinear = new DefaultListModel<>();
        DefaultListModel<String> dlmBinary = new DefaultListModel<>();
        DefaultListModel<String> dlmInterpolation = new DefaultListModel<>();
        DefaultListModel<String> dlmRedBlack = new DefaultListModel<>();
        
        ArrayList<Integer> indexOfElem = new ArrayList<Integer>();
        int random;
        Random rand = new Random();
        for(int i=0; i<Integer.valueOf(String.valueOf(jTextField4.getText())); i++){
            while(true){
                random = rand.nextInt(elementsCounter);
                if(!(indexOfElem.contains(random))){
                    indexOfElem.add(random);
                    break;
                }                    
            }
        }
        
        StringBuilder str = new StringBuilder();
        ArrayList<Long> meanTime = new ArrayList<Long>();
        
        //linear experiment
        for(int i : indexOfElem){
            str.setLength(0);
            MySearchClass sc = new MySearchClass("Linear",myList.get(i));
            long[] returnedValues = new long[2];
            returnedValues=sc.returnTheStuff();
            str.append(myList.get(i)+",#"+String.valueOf(returnedValues[0])+",t="+String.valueOf((long)(returnedValues[1]/1000))+"ms");
            dlmLinear.addElement(String.valueOf(str));
            meanTime.add((long)(returnedValues[1]/1000));
        }
        jLinearExp.setModel(dlmLinear);
        double mean=0;
        for(long i:meanTime){
            mean+=i;
        }
        mean=mean/(Integer.valueOf(String.valueOf(jTextField4.getText())));
        jTextField5.setText(String.valueOf(mean)+"ms");
        
        //binary experiment
        meanTime.clear();
        for(int i : indexOfElem){
            str.setLength(0);
            MySearchClass sc = new MySearchClass("Binary",myList.get(i));
            long[] returnedValues = new long[2];
            returnedValues=sc.returnTheStuff();
            str.append(myList.get(i)+",#"+String.valueOf(returnedValues[0])+",t="+String.valueOf((long)(returnedValues[1]/1000))+"ms");
            dlmBinary.addElement(String.valueOf(str));
            meanTime.add((long)(returnedValues[1]/1000));
        }
        jBinaryExp.setModel(dlmBinary);
        mean=0;
        for(long i:meanTime){
            mean+=i;
        }
        mean=mean/(Integer.valueOf(String.valueOf(jTextField4.getText())));
        jTextField6.setText(String.valueOf(mean)+"ms");
        
        //interpolation experiment
        meanTime.clear();
        for(int i : indexOfElem){
            str.setLength(0);
            MySearchClass sc = new MySearchClass("Interpolation",myList.get(i));
            long[] returnedValues = new long[2];
            returnedValues=sc.returnTheStuff();
            str.append(myList.get(i)+",#"+String.valueOf(returnedValues[0])+",t="+String.valueOf((long)(returnedValues[1]/1000))+"ms");
            dlmInterpolation.addElement(String.valueOf(str));
            meanTime.add((long)(returnedValues[1]/1000));
        }
        jInterpolationExp.setModel(dlmInterpolation);
        mean=0;
        for(long i:meanTime){
            mean+=i;
        }
        mean=mean/(Integer.valueOf(String.valueOf(jTextField4.getText())));
        jTextField7.setText(String.valueOf(mean)+"ms");
        
        
        //rb tree experiment
        meanTime.clear();
        for(int i : indexOfElem){
            str.setLength(0);
            int[] results = mrbt.mySearch(myList.get(i));
            if(results[2]==0)
                continue;
            str.append(myList.get(i)+",Height:"+String.valueOf(results[1])+",t="+String.valueOf((long)(results[3]/1000))+"ms");
            dlmRedBlack.addElement(String.valueOf(str));
            meanTime.add((long)(results[3]/1000));
        }
        jRBexp.setModel(dlmRedBlack);
        mean=0;
        for(long i:meanTime){
            mean+=i;
        }
        mean=mean/(Integer.valueOf(String.valueOf(jTextField4.getText())));
        jTextField8.setText(String.valueOf(mean)+"ms");        
    }//GEN-LAST:event_jExecuteTimesActionPerformed

