    private void jButton3ActionPerformed(java.awt.event.ActionEvent evt) {//GEN-FIRST:event_jButton3ActionPerformed
        DataStructuresProjectMergesort dsp = new DataStructuresProjectMergesort("integers.txt");
        try {
            dsp.dspRun("outputFile");
            JOptionPane.showMessageDialog(null, "File integers.txt sorted into \"outputFile\"");
            jLabel24.setText("Operation completed succesfully!");
            sortedFile=true;
            jLabel27.setText(dsp.myList.get(0)+","+dsp.myList.get((dsp.myList.size())/4)+","+dsp.myList.get((dsp.myList.size())/2)+","+dsp.myList.get((3*(dsp.myList.size()))/4)+","+dsp.myList.get(dsp.myList.size()-1));
        } catch (IOException ex) {
            Logger.getLogger(MainWindows.class.getName()).log(Level.SEVERE, null, ex);
            JOptionPane.showMessageDialog(null, "There was an error creating the Sorted output.");
            jLabel24.setText("Operation terminated abnormaly");
        }
    }//GEN-LAST:event_jButton3ActionPerformed

